.Header
{
    .slider
    {
        &-indicator
        {
            button
            {
                position: relative;
                width: 18px;
                height: 18px;
                border-radius: 50%;
                border: 1px solid #fff;
                background-color: transparent;
                z-index: 1;
                span
                {
                    background-color: #fff;
                    width: 16px;
                    height: 16px;
                    display: inline-block;
                    position: absolute;
                    top: 1px;
                    left: 1px;
                    border-radius: 50%;
                    z-index: -1;
                }
            }
        }
        &-slides
        {
            &-img
            {
                width: 100vw;
                height: 100vh;
                background-size: cover;
                background-position: 50% 30%;
                background-repeat: no-repeat;
            }
            &:first-of-type
            {
                .slider-slides-img
                {
              
                    background-image: url(/images/bg_1.jpg.webp) ;
                }
            }
            &:nth-of-type(2)
            {
                .slider-slides-img
                {
                    background-image: url(/images/bg_2.jpg.webp) ;
                }
            }
            &:last-of-type
            {
                .slider-slides-img
                {
                    background-image: url(/images/bg_3.jpg.webp) ;
                }
            }
            &-btn
            {
                button
                {
                    padding: 1.2rem 1.5rem;
                    cursor: pointer;
                    transition: background-color,border,color 300ms ease-in-out;
                    &:first-of-type
                    {
                        background-color: $primary-color;
                        color: $primary-dark-color;
                        margin-right: .1rem;
                        &:hover
                        {
                            border: 1px solid $secondary-color;
                            color: $secondary-color;
                            background-color: transparent;
                        }
                    }
                    &:last-of-type
                    {
                        border: 1px solid $secondary-color;
                        color: $secondary-color;
                        &:hover
                        {
                            background-color: $primary-color;
                            color: $primary-dark-color;
                            border: 1px solid transparent;
                        }
                    }
                }
            }
        }
    }
}

