.main-sec1
{
    padding: 1rem 0 0 0;
    background-color: $primary-text-color;
    color: $secondary-color;
    &-container
    {
        @include media('tab-port')
        {
            width: 100%;
        }
        &-Details
        {
            &-icon
            {
                margin-right: 1rem;
                i
                {
                    color: $primary-color;
                }
            }
            p
            {
                color: $secondary-dark-color;
            }
        }
    
        &-form
        {
            background-color: $primary-color;
            margin-top: -3%;
            z-index: 1;
            height: auto;
            @include media('tab-port')
            {
                margin-top: 0;
            }
            form
            {
                padding: 1rem;
                height: 100%;  
                input
                {
                    border-bottom: 1px solid rgba($secondary-color,.2);
                    margin-right: .7rem;
                    margin-bottom: 1rem;
                    padding-bottom: .4rem;
                }
                textarea
                {
                    border-bottom: 1px solid rgba($secondary-color,.2); 
                    margin-right: .7rem;
                    @include media('tab-port')
                    {
                        width: 100%;
                    } 
                }
                ::placeholder
                {
                    color: rgba($secondary-color,.8);
                }
                div
                {
                    @include media('tab-port')
                    {
                        flex-direction: column;
                    }   
                }
            }
        }
    }

}

