.sec-col3
{
    background-color: $primary-color;
    padding: 6rem 8rem;
    &-parent
    {
        @include media('tab-port')
        {
            flex-wrap: wrap;
        }
        &-sec
        {
            margin-right: 1.3rem;
            @extend %col-3;
            &-icon
            {
                margin-bottom: 2rem;
                i
                {
                    color: $primary-dark-color;
                    position: relative;
                    display: inline-block;
                    padding: 1rem;
                    &::after
                    {
                        content: "";
                        display: inline-block;
                        z-index: -1;
                        border: 1px solid $primary-dark-color;
                        position: absolute;
                        width: 100%;
                        height: 100%;
                        top: 0;
                        left: 0;
                        z-index: 1;
                    }
                }
            }
        }
    }
}
